import React from 'react';

class LogIn extends React.Component {
	constructor(props) {
		super(props);
	}
	render() {
		let st = " hidden";
		if(this.props.click) {
			st = ""
		}
		return (
			<div className={'popup' + st}>
				<p>Iniciar Sesion</p>
				<form>
					<input type="text" placeholder='username'/>
					<input type="password" placeholder='password'/>
					<button>Ingresar</button>
				</form>
			</div>
        );
	}
}

export default LogIn;
